import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Router } from 'react-router-dom';

ReactDOM.render(
  <React.StrictMode>
    <Router></Router>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
